('8d98047f-7583-9531-989f-4fe2e6c2bd02', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'клиентка от партнеров Нины Волковой из Мосвкы\r\n\r\n"Коста Бланка. Аликанте-Бенидорм (не Торревьеха)\r\nАпартаменты-таунхаус в урбанизации. Не высотное строительство.\r\nБюджет 250 000 в наличии+ ипотека(если объект дороже).\r\nНе меньше 120 кв м , 3 спальни , удаленность от моря не имеет значения( собираются покупать машину и на ПМЖ)\r\n2 ребенка(6+3). Про школу пока не уверенна.\r\nСобирается лететь в январе-феврале. Уточните , пожалуйста  про праздники( когда лететь, чтобы и билеты не дорого и все открыто было).\r\nКлиентка от моих партнеров( раньше рассматривала Италию) .Абсолютно конкретная."\r\n', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
