('aac30dca-777d-d7c0-aa4e-4fe2e66d140c', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'FERIA SPB 29 OCT 2011 LEN EXPO.\r\nКоста Дорада, Таррагона, Аликанте.Ребенок 11 лет.Нужна информация по испанским платным школам и университетам гумантарных наук и медицины( не технические науки!!!)Где подойдет уни верситет,там и будут смотреть нежвижимость. Апартаменты,таунхаус, 100-150 кв.м., 2-3 спальни,ВНЖ. Без кредита. 200.000€.', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russia', 'San Petersburgo', 'SPB '),
