('d26e08d5-8247-d231-576c-4fe2e66dff80', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'К Андрею Владимировичу на встречу приходил Алексей Олегович Васильев. По его словам, он узнал о нас из журнала.\r\nПо всей видимости он собирается там заниматься продажей недвижимости.\r\nУ него есть в Кальпе земля. Он хочет построить там два индивидуальных дома, а также арендовать офис в Бенидорме (80-100кв м ).Андрей Владимирович говорит, что вроде Solap съезжает из своего офиса, и можно Алексею предложить.\r\nКроме офиса, Алексею нужен архитектор и строительная компания.\r\n', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russia', 'San Petersburgo', 'San Petersburgo'),
('dd88005f-4c5d-6397-1eac-4fe2e692fd57', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'Знакомая Валерия Малышева.\r\n120.000 - 140.000€. 2 - 3 спальни, Пожелания наверное остались прежними, но мы с мужем подумали, что можно рассматривать и до 2 км. от моря если это будет хороший зеленый район и рядом магазины  (продуктовые).\r\nПо месторасположению (городу/местности) принципиальных ограничений нет – будем смотреть все\r\nПо самому объекту  - 2 спальни, если попадутся по этой цене 3 спальни будет идеально.\r\nЕсли будет хороший вариант чуть дороже тоже можно будет рассмотреть – постараемся как-нибудь решить этот вопрос. \r\nВообще в идеале конечно же желательно рядом какие-то насаждения с теньком – но это рассматривайте только как пожелание.\r\nМожно так же (если цена позволяет) рассматривать дуплексы.\r\n', NULL, 'skype: tigratigara', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('e8340d3c-f25b-139e-3ef5-4fe2e6c93dc3', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'тишинка 10/11\r\nотель от 25 номеров  и больше, от 1000 кв.м ,1 линия,от 2 млн евро и выше', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('f2220657-b74d-7161-531c-4fe2e6e4f4f1', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'Людмила Тарасова работает в компании, которая занимается российской недвижимостью, но обратилась к нам с заявкой от клиента по зарубежке. Она говорит, что в принципе есть еще.\r\n\r\nЗаявка:\r\nЦыбаев Евгений Викторович 19.12.1975 г.р Цыбаева Галина Александровна 03.02.1975 Цыбаева Александра Евгеньевна 29.06.97 Цыбаева таисия Евгеньевна 22.05.05 скороее всего будет оформлять на жену ,так как хочет сделать ей подарок ,но может оформить и на себя .\r\n\r\nПервичка земля +дом с помощью нас построить \r\n(раз мы застройщики, то можем помочь ему построить свой дом. Сам товарищ связан со строительным бизнесом тут, в России.)\r\n\r\nВторичка дом от 150 м- 200 м ,земля от маленького до среднего Побережье,тихое спокойное место ,не горы с яхт клубом неподалеку.\r\n\r\nГ-на Цибаева интересует сравнение цен на вариант «земля+построить дом» и уже готовый дом.\r\n', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russia', 'San Petersburgo', 'San Petersburgo'),
('febb0482-6e2a-5e87-e8e6-4fe2e611134f', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'Появился новый клиент Михаил Гилев.(узнал о нас из рекламы в журнале самолета) \r\nОн хочет купить какой-нибудь бизнес, который будет приносить доход 15-20 тыс. евро в месяц. Он в раздумьях, можно предложить ему какую-нибудь идею.\r\nЭто может быть, например, несколько квартир или дом+гостиница+ресторан или купить /построить яхтовый порт или что-нибудь  еще. Его интересует Барселона и Аликанте.  И в итоге хочет уехать туда, также его интересует ВНЖ. Михаил уже смотрел яхт порт в Таррагоне.\r\nУ Михаила все эти планы долгосрочные,  но есть друг, который может уехать туда и быстрее.\r\n', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russia', 'Salekhard', 'Salekhard'),
('109c0a2c-f00c-9bda-b94c-4fe2e65a2ef2', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'не с выставок.\r\n\r\nАндрей Владимирович встречался с ним в Москве по поводу недвижимости и ВНЖ. Николай от посредника, поэтому и это  надо учесть.\r\nВообще Николай  сначала хотел арендовать апартаменты ( он может рассмотреть и на брава и на бланка, но конечно нам лучше, чтобы он приехал к нам), а потом покупать. Он ориентирован покупать на Брава, но если в итоге поедет на бланку арендовать, можно будет ему показать недвижимость у нас.\r\n\r\nИзначально Николай хотел арендовать апартаменты с 15-20 января на 2,5 месяца: 2-3 спальни, от 80 кв. м. с отоплением, прогулочной дорогой, инфраструктурой, до моря не принципиально.\r\nПо покупке Николая интересуют :  квартиры в жилых комплексах с бассейном,с 2-3 спальнями от 80 до 130 кв.м.,м 1я линия, а вообще до 600-700 м до моря, бюджет 150 тыс. евро, близость детских садов. Не в самой Барселоне, а , например, Бланес, Ллорет де Мар, Малграт де Мар и др. Можно рассмотреть Аликанте.\r\n\r\nКроме того, у Николая есть друзья, которые хотят купить дом под Барселоной, до 200кв. м.; квартиру в центре Барселоны, от 80-100 кв. м. недалеко от пляжа олимпик; квартиру по таким же параметрам как у Николая для покупки в том же окрестном городке, а не в самой Барсе. Также друзья Николая думают вложиться в какой-нибудь бизнес с гарантированным доходом.\r\n\r\nВ итоге: Николай поедет в марте вдвоем с женой не очень надолго. Он ждет варианты по покупке по Бланке и Браве. Надо  прислать ему варианты по Торревьехе и по Аликанте. Буду ждать варианты, чтобы прислать ему в сравнении в обоих городах.\r\n', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('11579a7d-f50d-7106-f723-4fe2e6ff8082', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'Есть новый клиент не с выставок, знакомый Андрея Владимировича- Дмитрий Бельдин.\r\nОн, жена и ребенок думают отдохнуть летом в Испании и заодно посмотреть недвижимость.\r\nА.В. его отговаривал от августа, поэтому ориентируемся на июнь-июль.\r\nДмитрий думает снять дом или апартаменты, минимум 2 спальни, пешком до моря сроком на 2 недели.\r\n', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
