('1287123b-4b63-2f33-f427-4fe2e6e861e8', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'От: Вячеслав Приходько <naukaprsl@ukr.net>\r\nДата: 20 января 2012 г., 20:31:15 Московское стандартное время\r\nКому: nosov@costaiberia.ru\r\nТема: К\r\nКлиент ищет недвижимость - Альбир и Альтеа (на побережье).\r\nРассмотрим любые варианты в 10 км ОТ МОРЯ.\r\nВарианты чем ближе к морю, тем лучше.\r\nИнтересует кредитование, условия.\r\n                       Стоимость до 250 000 евро.\r\n                       Условия приема клиента и программа.\r\n \r\nС уважением, Вячеслав.\r\n', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russia', NULL, ''),
